from typing import Optional
from pydantic import BaseModel, Field

# Test if we can use the __signature__ workaround
class Test(BaseModel):
    not_: Optional[str] = Field(None, alias='not')

    class Config:
        allow_population_by_field_name = True

    def __init__(self, **data):
        # Manually handle the 'not' parameter
        if 'not' in data:
            data = {**data, 'not_': data.pop('not')}
        super().__init__(**data)

    @property
    def not(self):
        return self.not_

t = Test(not='test')
print('Success:', t.not)
print('Dict:', t.dict(by_alias=True))
print('Dict without alias:', t.dict(by_alias=False))
