def build_param(self, **kwargs):
    if 'schema' in kwargs:
        schema = kwargs.pop('schema')
        # If schema is a Component type (e.g., @component.parameter),
        # use component_type="parameters" instead of "schemas"
        if isinstance(schema, type) and issubclass(schema, Component):
            kwargs['schema'] = create_schema(schema, component_type='parameters')
        else:
            kwargs['schema'] = create_schema(schema)
